script: |
  super -f text -I q6770.spq | sort > q6770.out

inputs:
  - name: q6770.spq
    data: |
      SELECT ( - col1 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( ( + col1 IN ( 20, - col0 * - col1 + - col0, - 51 + 17 + - ( - + col0 ), - - ( + 18 ) ) ) );
  - name: tab2

outputs:
  - name: q6770.out
    data: |
      -51
      -67
      -77
